import "./App.css";
import Select from "react-select";
import { useEffect, useState } from "react";
import axios from "axios";

function App() {
  const [data, setDatas] = useState([]);
  useEffect(() => {
    const getBerries = async () => {
      try {
        const callBerries = await axios.get("https://pokeapi.co/api/v2/berry/");
        setDatas(callBerries.data.results);
      } catch (err) {
        console.log(err);
      }
    };
    getBerries();
  }, []);

  return (
    <div className="App">
      {data.map((data) => {
        return <Select options={data} key={data.name} />
      })}
    </div>
  );
}

export default App;
